import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import AdminIndex from '../Pages/Admin/Admin';



function App() {
  return (
    <Router>
      <Switch>
        <Route exact path={"/admin"} component={AdminIndex} />

      </Switch>
    </Router>
  );
}

export default App;
